update Price
set PartID = pa.partid
from Price p
inner join
part pa
on p.temp = pa.PartPrimary 
go


update part
set PriceID = p.priceid
from Part pa
inner join
price p
on pa.PartID = p.PartID
go

alter table dbo.Price
drop column [temp]
go

alter table dbo.Part
alter column [PriceID] int not null
go

alter table dbo.Price
alter column [PartID] int not null
go


insert into dbo.altpartid
select partid, partprimary
from dbo.part
go


update part
set AltPartID = alt.altpartid
from part pa
inner join 
AltPartID alt
on alt.PartID = pa.PartID
go